import React from "react";

const name = "sumit Singh";
const img1 = "https://picsum.photos/200";
const img2 = "https://picsum.photos/200";
const img3 = "https://picsum.photos/200";

const App =()=> {
  return(
   <div>
    <h1 className="heading">{name}</h1>
    <img src={img1} alt="randomimgs"/>
    <img src={img2} alt="randomimgs"/>
    <img src={img3} alt="randomimgs"/>
    </div>
  )
};

export default App;
